import React from "react";



const App = ()=>{

    const createDigit = ()=>{
      const digit = [];
      for(let i=0;i<10;i++){
        digit.push(
          <button key={i}>{i}</button>
        )
      }
      return digit;
    }

  return(
    <div className="App">
      <div className="claculator">
        <div className="display">
          <span>(0)</span> 0

        </div>
        <div className="operator">
          <button >+</button>
          <button >-</button>
          <button >/</button>
          <button >*</button>
          <button >DEL</button>
        </div>

        <div className="digit">
          { createDigit()}

          <button>0</button>
          <button>.</button>
          <button>=</button>
        </div>

      </div>
    </div>
  )

}



export default App;
